console_error_panic_hook 크레이트는 console.error 함수를 사용하여 예상치 못한 패닉들을 로그합니다. 이 크레이트를 통해 외계어같이 보이고 디버깅하기 어려운 RuntimeError: unreachable executed 에러 메세지 대신 Rust 환경에서 로그했던 것과 같이 깔끔하게 포맷된 패닉 메세지를 표시할수 있습니다. 정말 간단하게도 코드가 시작되는 함수에서 console_error_panic_hook::set_once()를 호출해서 훅(hook)을 설정하기만 하면 됩니다. #[wasm_bindgen]
pub fn init_panic_hook() { console_error_panic_hook::set_once();
}

