말처럼 쉽지는 않겠지만, twiggy 와 같은 툴을 사용하거나 LLVM-IR 파일을 살펴보면서 어떤 함수들이 패닉하는지 살펴볼 수 있습니다. 패닉이 항상 panic!() 매크로의 형식으로 나타나지는 않고 보통은 다음과 같은 여러가지 다양한 이유로 발생할 수 있습니다: 슬라이스 사이즈 범위를 벗어난 인덱스의 요소에 접근하고자 시도할 때 (out of bounds) : my_slice[i] 나머지 연산자를 사용할때 나누는 수가 0인 경우: 나눠지는 수 / 나누는 수 Option이나 Result의 값을 unwrap()를 사용하여 값에 접근할 때: opt.unwrap() 또는 res.unwrap() 처음 두 방법 대신 사용해볼수 있는 더 안전한 방법들도 있습니다. my_slice[i] 처럼 인덱스를 통해 직접 접근하지 않고 my_slice.get(i) 를 사용하여 Option 타입의 값에 접근해볼수도 있고, check_div 함수를 불러서 값을 나눌수 있는지 확인해볼수도 있습니다. 이렇게 3번쨰 경우만 집중적으로 신경쓸수 있게 됐습니다. 추가로, 코드를 패닉시키지 않으면서 Option이나 Result 타입의 값을 "안전한 방법과 불안전한 방법", 두 가지 방법으로 처리해볼수도 있습니다. 안전한 방법부터 한번 살펴보도록 합시다. None이나 Error 값을 반환받았을때 코드를 패닉시키는 대신 abort 함수를 사용해보겠습니다: #[inline]
pub fn unwrap_abort<T>(o: Option<T>) -> T { use std::process; match o { Some(t) => t, None => process::abort(), }
} 최종적으로는 패닉 코드가 wasm32-unknown-unknown 타겟의 abort 명령어로 옮겨지기 때문에, 이런 식으로 코드를 작성하면서 불필요한 코드를 지울수 있게 됩니다. 다른 시도해볼수 있는 방법으로는, unreachable 크레이트 가 있습니다. 이 크레이트는 Option과 Result 타입의 값들과 함께 사용할수 있도록 불안전한 unchecked_unwrap 확장 크레이트들 을 제공하는데, 컴파일러가 Option을 Some으로, Result를 Ok로 추측 해서 옮길수 있도록 도와줍니다. 하지만 이런 추측이 맞아떨어지지 않으면 정의하지 않은 동작 (undefined behavior) 이 발생하게 되므로 코드가 잘 작동한다고 확신하지만 컴파일러가 잘 모르고 있는 상황을 잘 이해하고 있을 때만 이 방법을 사용해주세요. 일반적으로는 이 방법을 배포 버전에서만 적용하고 그 외에는 컴파일러가 확인할수 있도록 디버그 빌드를 따로 설정하길 권장합니다.

