사용자 정의 섹션을 통해 wasm 모듈에 명명된 임의의 데이터를 임베딩할 수 있습니다. 이 섹션 데이터는 컴파일 시점에 설정되며 wasm 모듈에서 직접 읽을 수 있지만 런타임에서는 이 모듈을 수정할 수 없습니다. Rust 코드에서 다음과 같이 사용자 정의 섹션을 정적 배열 ([T; size])로 나타내고 #[link_section] 속성으로 노출시킬 수 있습니다: #[link_section = "hello"]
pub static SECTION: [u8; 24] = *b"This is a custom section"; 이 코드는 wasm 파일에 hello 라는 사용자 정의 섹션을 추가합니다. 변수 이름 SECTION 은 임의로 명명됐으며 이 이름을 변경해도 코드의 동작이 바뀌지 않습니다. 이 변수에 텍스트 바이트 (bytes of text) 를 사용했지만 다른 임의의 데이터를 사용할 수도 있습니다. 이런 사용자 정의 섹션은 JS 사이드에서 WebAssembly.Module.customSections 함수를 사용하여 읽을 수도 있습니다. 이 함수를 호출할 때, wasm 모듈과 섹션 이름을 인자로 주고 ArrayBuffer 의 배열을 반환받게 됩니다. 여러 섹션들이 같은 이름을 공유하게 할수도 있는데, 이 경우에는 한 배열에 여러 섹션들을 담게 됩니다. WebAssembly.compileStreaming(fetch("sections.wasm"))
.then(mod => { const sections = WebAssembly.Module.customSections(mod, "hello"); const decoder = new TextDecoder(); const text = decoder.decode(sections[0]); console.log(text); // -> "사용자 정의 섹션을 콘솔에 출력합니다"
});

