Wasm은 아직 스레드를 지원하지 않습니다. (하지만 실험적으로 지원 작업이 진행되고 있긴 합니다. ) 그러므로, wasm에서 스레드를 생성하려고 시도하면 코드가 패닉하게 됩니다. #[cfg(..)]를 사용하여 타겟이 WebAssembly인지 아닌지 여부에 따라 스레드와 비스레드 코드를 따로 작성해볼수도 있습니다: #![cfg(target_arch = "wasm32")]
fn do_work() { // 이 스레드에서만 작업을 수행합니다...
} #![cfg(not(target_arch = "wasm32"))]
fn do_work() { use std::thread; // 헬퍼 스레드를 사용해서 작업을 확장합니다... thread::spawn(|| { // ... });
} 파일 I/O를 제거하고 유저들이 I/O 코드를 따로 가져올수 있도록 허용하는 접근 방식과 유사하게, 스레드 생성 코드를 라이브러리에서 제외시킨 다음 유저들이 스레드 코드나 라이브러리를 따로 가져올수 있도록 변경해볼수도 있습니다. 이렇게 구현했을때 라이브러리 사용자들이 직접 스레드 풀 코드를 마련할수 있게 되는 긍정적인 부수 효과를 보게 됩니다.

