Rust 코드에서 String을 생성 (및 할당) 하고 wasm-bindgen로 이 생성한 값을 유효한 JavaScript 문자열로 변환하면 세포들을 불필요하게 복사하게 됩니다. 우리가 JavaScript 코드에서 세상의 너비와 높이를 이미 알고 있고, 세포를 만드는 처리가 이루어지는 WebAssembly 선형 메모리를 읽을 수 있기 때문에, render 메소드를 수정하여 cells 배열의 시작을 가리키는 포인터를 대신 반환해보도록 합시다. 그리고 유니코드 문자를 렌더링하지 않고 Canvas API 를 대신 사용해봅시다. 이 API를 이 부분 이후부터 계속 사용하겠습니다. wasm-game-of-life/www/index.html 파일에서 이전에 추가한 <pre>를 지우고 렌더링에 사용할 <canvas>를 추가해주세요. (<body> 태그 내에서 JavaScript 코드를 시작시키는 <script> 태그 위에 추가돼야 합니다.) <body> <canvas id="game-of-life-canvas"></canvas> <script src='./bootstrap.js'></script>
</body> Rust로 구현한 코드에서 필요한 정보를 얻어올 수 있도록 세상의 넓이, 너비, 세포 배열을 가리키는 포인터를 반환하는 getter 함수들을 조금 더 작성해보겠습니다. 이 함수들도 JavaScript 코드로 노출시켜야 하니 잘 확인해주고, wasm-game-of-life/src/lib.rs 파일에 다음 코드를 추가해주세요: /// Public 메소드, JavaScript로 익스포트 할수 있도록 함.
#[wasm_bindgen]
impl Universe { // ... pub fn width(&self) -> u32 { self.width } pub fn height(&self) -> u32 { self.height } pub fn cells(&self) -> *const Cell { self.cells.as_ptr() }
} 그 다음, wasm-game-of-life/www/index.js 파일의 wasm-game-of-life 모듈에서 Cell을 임포트하는 줄을 추가해준 다음 캔버스를 렌더링할때 사용할 상수 몇가지를 정의해주세요: import { Universe, Cell } from "wasm-game-of-life"; const CELL_SIZE = 5; // px
const GRID_COLOR = "#CCCCCC";
const DEAD_COLOR = "#FFFFFF";
const ALIVE_COLOR = "#000000"; 이제 <pre> 태그의 textContent 대신에 <canvas>를 업데이트 할수 있도록 JavaScript 나머지 코드를 다시 작성해주세요: // Universe를 생성하고 너비와 높이를 반환받습니다.
const universe = Universe.new();
const width = universe.width();
const height = universe.height(); // 캔버스에 세포들을 표시할 공간을 만들어주고, 각 세포들이 1px 두께의 테두리를 가질수 있도록 해줍니다.
const canvas = document.getElementById("game-of-life-canvas");
canvas.height = (CELL_SIZE + 1) * height + 1;
canvas.width = (CELL_SIZE + 1) * width + 1; const ctx = canvas.getContext('2d'); const renderLoop = () => { universe.tick(); drawGrid(); drawCells(); requestAnimationFrame(renderLoop);
}; 세포들 사이에 격자를 그리려면 일정한 간격으로 나란히 놓인 수평선과 수직선을 그려줍니다. 이러한 선들은 교차하여 격자를 형성하게 됩니다. const drawGrid = () => { ctx.beginPath(); ctx.strokeStyle = GRID_COLOR; // 수직줄 for (let i = 0; i <= width; i++) { ctx.moveTo(i * (CELL_SIZE + 1) + 1, 0); ctx.lineTo(i * (CELL_SIZE + 1) + 1, (CELL_SIZE + 1) * height + 1); } // 수평줄 for (let j = 0; j <= height; j++) { ctx.moveTo(0, j * (CELL_SIZE + 1) + 1); ctx.lineTo((CELL_SIZE + 1) * width + 1, j * (CELL_SIZE + 1) + 1); } ctx.stroke();
}; raw wasm 모듈인 wasm_game_of_life_bg에 정의된 memory를 임포트해서 WebAssembly의 선형 메모리에 직접 접근할 수 있습니다. 세포를 그리려면 우선 세상에 있는 세포들을 가리키는 포인터를 반환받고 세포 버퍼(buffer)를 오버레이(overlay)하는 Uint8Array 객체를 생성해야 합니다. 그 다음 각 세포를 순회하여 생존 여부에 따라 흰색 또는 검은색 사각형을 그립니다. 포인터를 오버레이하게 되면서, 모든 틱마다 세포들을 복사하지 않도록 최적화 작업을 해줄수 있습니다. // WebAssembly 메모리를 파일 최상단에 임포트해줍니다.
import { memory } from "wasm-game-of-life/wasm_game_of_life_bg"; // ... const getIndex = (row, column) => { return row * width + column;
}; const drawCells = () => { const cellsPtr = universe.cells(); const cells = new Uint8Array(memory.buffer, cellsPtr, width * height); ctx.beginPath(); for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); ctx.fillStyle = cells[idx] === Cell.Dead ? DEAD_COLOR : ALIVE_COLOR; ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); } } ctx.stroke();
}; 이전에 보여드린 코드를 사용해서 렌더링 처리를 시작해보겠습니다: drawGrid();
drawCells();
requestAnimationFrame(renderLoop); drawGrid()와 drawCells() 두 함수를 requestAnimationFrame() 함수 호출 이전에 호출해야 한다는 점을 꼭 기억해주세요. 초기 상태의 세상이 그려진 이후에 수정사항을 적용해야 합니다. requestAnimationFrame(renderLoop) 함수만 호출하게 된다면 universe.tick()이 호출된 이후 시점의 두번째 틱이 대신 그려지게 됩니다.

