space ship 패턴 하나를 표시하는 세상을 만들어보세요. 초기 세상을 하드코딩 하는 대신, 각 세포가 50% 확률로 살아있거나 죽어있는 상태로 랜덤하게 생성될수 있도록 해보세요. 힌트: the js-sys crate 크레이트를 사용하여 Math.random JavaScript 함수 를 임포트해보세요. 정답 먼저, wasm-game-of-life/Cargo.toml 파일을 열고 js-sys를 종속성으로 추가해주세요: # ...
[dependencies]
js-sys = "0.3"
# ... 그 다음 js_sys::Math::random 함수를 사용해서 50% 확률로 값을 결정해주세요: extern crate js_sys; // ... if js_sys::Math::random() < 0.5 { // 세포가 살아있게 함
} else { // 세포가 죽어있게 함
} 각 세포를 byte 값으로 표현하면서 순회를 쉽게 할수 있지만, 메모리 자원을 낭비한다는 단점이 있습니다. 1 byte는 8 bit인데, 실제로 세포 생존 여부를 표시할 때는 1 bit만 사용하고 있습니다. 이 데이터 표현을을 리팩토링하여 각 세포가 1 bit의 사이즈만 사용할수 있도록 코드를 작성해보세요. 정답 Rust 언어에서 Vec<Cell> 타입 대신 (추가 기능을 제공하는 라이브러리인) fixedbitset 크레이트의 FixedBitSet 타입 을 사용하여 세포들을 나타내볼수도 있습니다. // Cargo.toml에 종속성을 추가했는지 확인해주세요!
extern crate fixedbitset;
use fixedbitset::FixedBitSet; // ... #[wasm_bindgen]
pub struct Universe { width: u32, height: u32, cells: FixedBitSet,
} Universe의 생성자를 다음과 같이 수정해보겠습니다: pub fn new() -> Universe { let width = 64; let height = 64; let size = (width * height) as usize; let mut cells = FixedBitSet::with_capacity(size); for i in 0..size { cells.set(i, i % 2 == 0 || i % 7 == 0); } Universe { width, height, cells, }
} 다음 틱에서 세포를 업데이트할수 있도록 FixedBitSet 타입의 set 메소드를 사용해봅시다: next.set(idx, match (cell, live_neighbors) { (true, x) if x < 2 => false, (true, 2) | (true, 3) => true, (true, x) if x > 3 => false, (false, 3) => true, (otherwise, _) => otherwise
}); JavaScript에서 시작하는 bit를 가리키는 포인터를 반환해야 하므로, FixedBitSet 타입을 슬라이스(slice)로 변환한 다음 변환된 슬라이스를 포인터로 다시 변환해주세요: #[wasm_bindgen]
impl Universe { // ... pub fn cells(&self) -> *const u32 { self.cells.as_slice().as_ptr() }
} JavaScript의 wasm 메모리에서 Uint8Array를 생성해오는 방법은 이전과 동일합니다. 하지만 이번에는 각 세포를 나타내기 위해 byte 대신 bit을 사용하므로 배열의 길이가 더이상 width * height가 아니고 width * height / 8이 되어야 하니 다시 잘 확인해주세요: const cells = new Uint8Array(memory.buffer, cellsPtr, width * height / 8); 다음 함수를 사용하여 인덱스와 Uint8Array가 주어질 때 n 번째 bit의 값이 0인지 1인지 확인할 수 있습니다: const bitIsSet = (n, arr) => { const byte = Math.floor(n / 8); const mask = 1 << (n % 8); return (arr[byte] & mask) === mask;
}; 이제 준비가 됐으니 drawCells 함수를 다음과 같이 업데이트 해줍시다: const drawCells = () => { const cellsPtr = universe.cells(); // 수정된 부분입니다! const cells = new Uint8Array(memory.buffer, cellsPtr, width * height / 8); ctx.beginPath(); for (let row = 0; row < height; row++) { for (let col = 0; col < width; col++) { const idx = getIndex(row, col); // 수정된 부분입니다! ctx.fillStyle = bitIsSet(idx, cells) ? ALIVE_COLOR : DEAD_COLOR; ctx.fillRect( col * (CELL_SIZE + 1) + 1, row * (CELL_SIZE + 1) + 1, CELL_SIZE, CELL_SIZE ); } } ctx.stroke();
};

