어떤 사람들은 빨리 빨리 진행하는 것을 선호해서 매 프레임마다 1틱이 아니라 9틱씩 진행되도록 수정하고 싶을 수도 있습니다. 놀랍게도 이 작업은 wasm-game-of-life/www/index.js 파일의 renderLoop 함수를 수정해서 생각외로 간단하게 해볼수 있습니다: for (let i = 0; i < 9; i++) { universe.tick();
} 제 컴퓨터에서 구현한 게임이 35fps 속도로 다시 느려진 것 같습니다. 좋지 않은 현상이니 다시 60fps 로 만들어보겠습니다! 잘 확인해보면 Universe::tick 에서 시간이 많이 소요되는 것으로 보입니다. Timer를 추가해서 console.time과 console.timeEnd 호출을 감싸고 다시 한번 살펴보겠습니다. 제 예상대로라면 매 틱마다 세포의 새 벡터를 할당하고 기존 벡터를 해제(freeing)하는 작업은 많은 성능을 사용할 뿐 아니라 시간도 많이 소비하게 될것 같습니다. pub fn tick(&mut self) { let _timer = Timer::new("Universe::tick"); let mut next = { let _timer = Timer::new("다음 세포들을 할당합니다."); self.cells.clone() }; { let _timer = Timer::new("다음 세대를 처리합니다."); for row in 0..self.height { for col in 0..self.width { let idx = self.get_index(row, col); let cell = self.cells[idx]; let live_neighbors = self.live_neighbor_count(row, col); let next_cell = match (cell, live_neighbors) { // 규칙 1: 인구 부족으로 2개 미만의 이웃을 가진 세포는 죽게 됩니다. (Cell::Alive, x) if x < 2 => Cell::Dead, // 규칙 2: 2개 혹은 3개의 이웃을 가진 세포는 다음 세대에서 계속 살아있습니다. (Cell::Alive, 2) | (Cell::Alive, 3) => Cell::Alive, // 규칙 3: 과잉 인구로 3개 초과의 이웃을 가진 모든 세포는 죽게 됩니다. (Cell::Alive, x) if x > 3 => Cell::Dead, // 규칙 4: 세포 증식으로 정확히 3개의 이웃을 가진 세포는 살아나게 됩니다. (Cell::Dead, 3) => Cell::Alive, // 규칙이 적용되지 않는 세포들의 상태는 그대로 유지되게 됩니다. (otherwise, _) => otherwise, }; next[idx] = next_cell; } } } let _timer = Timer::new("기존 세포들을 해제합니다."); self.cells = next;
} 브라우저 개발자 도구에서 타이밍(timing)을 잘 확인해보면 이 예상이 사실은 명백하게 틀린 부분을 확인할 수 있습니다. 실제로는 대부분의 시간이 다음 세대 세포들을 계산하는데 사용되게 됩니다. 그리고 의외로 매 틱마다 벡터 값을 할당하고 해제하는 작업이 그렇게 성능을 많이 사용하지 않습니다. 다시 한번 정말 중요한 프로파일링을 해보겠습니다! Universe::tick 타이머 결과 값의 스크린샷 사용하게 될 테스트 기능 게이트 (test feature gate) 가 nightly 버전에 같이 포함돼 있기 때문에, nightly 컴파일러가 필요합니다. 그러면 벤치마킹에 이 기능을 한번 사용해보겠습니다. cargo benchcmp 이라는 툴도 필요하니 설치해주도록 합시다. 참고로 cargo benchcmp는 cargo bench로 생성한 마이크로 벤치마킹을 비교하는데 사용하는 작은 사이즈의 유틸리티입니다. WebAssembly와 동일한 작업을 수행하는 네이티브 코드인 #[bench]를 작성해봅시다. 이렇게 네이티브 코드를 작성하게 되면 더 많은 기능을 사용할수 있게 됩니다. 이제 새롭게 작성된 wasm-game-of-life/benches/bench.rs을 확인해보겠습니다: #![feature(test)] extern crate test;
extern crate wasm_game_of_life; #[bench]
fn universe_ticks(b: &mut test::Bencher) { let mut universe = wasm_game_of_life::Universe::new(); b.iter(|| { universe.tick(); });
} #[wasm_bindgen] 속성을 모두 주석처리 해주도록 하고, Cargo.toml 파일의 "cdylib"도 주석처리 해주겠습니다. 이렇게 주석처리를 하지 않으면 빌드가 실패하고 링크 오류(link errors)가 발생하게 됩니다. 준비가 다 됐다면, cargo bench | tee before.txt 명령어를 실행해서 코드를 컴파일하고 벤치마크를 실행해보겠습니다. | tee before.txt를 포함하면서 cargo bench 명령어의 출력값을 가져와서 before.txt 파일에 저장할 예정이니 이 부분도 다시 확인해주세요. $ cargo bench | tee before.txt Finished release [optimized + debuginfo] target(s) in 0.0 secs Running target/release/deps/wasm_game_of_life-91574dfbe2b5a124 running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Running target/release/deps/bench-8474091a05cfa2d9 running 1 test
test universe_ticks ... bench: 664,421 ns/iter (+/- 51,926) test result: ok. 0 passed; 0 failed; 0 ignored; 1 measured; 0 filtered out 여기서 바이너리 파일의 경로도 같이 표시되는 부분을 확인할 수 있습니다. 이번에는 운영체제의 프로파일러를 사용하여 벤치마킹을 다시 한번 해보겠습니다. 저는 리눅스(Linux)를 사용하고 있으니 perf 를 예제로 사용하겠습니다: $ perf record -g target/release/deps/bench-8474091a05cfa2d9 --bench
running 1 test
test universe_ticks ... bench: 635,061 ns/iter (+/- 38,764) test result: ok. 0 passed; 0 failed; 0 ignored; 1 measured; 0 filtered out [ perf record: Woken up 1 times to write data ]
[ perf record: Captured and wrote 0.178 MB perf.data (2349 samples) ] perf report 명령어로 프로파일을 로드하면, 예상한 대로 대부분의 시간이 Universe::tick를 실행하는데 소비되는 것을 확인할 수 있습니다: perf report 스크린샷 perf를 실행한 다음 a 키를 누르면 어떤 어셈블리 명령어(instruction)이 함수를 처리할 때 사용되고 있는지 확인할 수 있습니다: perf 화면에서 어셈블리 명령어를 표시하는 화면의 스크린샷 위 내용을 확인하면 26.67%의 시간이 이웃 세포들을 만들어내는 데 사용되고, 23.41%를 이웃들의 열 인덱스, 그리고 나머지 15.42%를 행 인덱스를 더하는데 사용되는 것을 알수 있습니다. 제일 많은 성능을 사용하는 세 명령어들 중, 두번째와 세번째로 비용이 많이 드는 명령어가 div 명령어인 부분도 확인할 수 있습니다. 이 div 구현들이 Universe::live_neighbor_count 함수에서 나머지 연산자로 인덱싱 하도록 구현했던 부분입니다. (modulo indexing logic) wasm-game-of-life/src/lib.rs 파일에서 live_neighbor_count를 정의했던 내용을 다시 떠올려봅시다: fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; for delta_row in [self.height - 1, 0, 1].iter().cloned() { for delta_col in [self.width - 1, 0, 1].iter().cloned() { if delta_row == 0 && delta_col == 0 { continue; } let neighbor_row = (row + delta_row) % self.height; let neighbor_col = (column + delta_col) % self.width; let idx = self.get_index(neighbor_row, neighbor_col); count += self.cells[idx] as u8; } } count
} 코드를 다시 확인해보면 if 블럭들로 첫째와 마지막 행과 열의 엣지 케이스(edge case) 를 처리하는데 코드를 불필요하게 길게 작성하는 대신 나머지 연산자 (modulo operator) 를 사용하고 있는 부분을 확인할 수 있습니다. row과 column 둘 다 세상의 가장자리에 있지 않고 나머지 연산자를 쓸 필요가 없는 일반적인 경우를 처리하는데도 div 명령어를 사용해서 많은 성능을 사용하는 부분도 확인됩니다. 반복문을 사용하는 대신에 if 문으로 이러한 엣지 케이스들을 처리하고, 여러 분기들을 CPU의 분기 예측기(branch predictor)가 예측하기 쉽도록 만들어보겠습니다. live_neighbor_count를 다음과 같이 다시 작성해봅시다: fn live_neighbor_count(&self, row: u32, column: u32) -> u8 { let mut count = 0; let north = if row == 0 { self.height - 1 } else { row - 1 }; let south = if row == self.height - 1 { 0 } else { row + 1 }; let west = if column == 0 { self.width - 1 } else { column - 1 }; let east = if column == self.width - 1 { 0 } else { column + 1 }; let nw = self.get_index(north, west); count += self.cells[nw] as u8; let n = self.get_index(north, column); count += self.cells[n] as u8; let ne = self.get_index(north, east); count += self.cells[ne] as u8; let w = self.get_index(row, west); count += self.cells[w] as u8; let e = self.get_index(row, east); count += self.cells[e] as u8; let sw = self.get_index(south, west); count += self.cells[sw] as u8; let s = self.get_index(south, column); count += self.cells[s] as u8; let se = self.get_index(south, east); count += self.cells[se] as u8; count
} 벤치마킹을 다시 해보겠습니다! 이번에는 출력되는 메세지들을 after.txt로 출력해봅시다. $ cargo bench | tee after.txt Compiling wasm_game_of_life v0.1.0 (file:///home/fitzgen/wasm_game_of_life) Finished release [optimized + debuginfo] target(s) in 0.82 secs Running target/release/deps/wasm_game_of_life-91574dfbe2b5a124 running 0 tests test result: ok. 0 passed; 0 failed; 0 ignored; 0 measured; 0 filtered out Running target/release/deps/bench-8474091a05cfa2d9 running 1 test
test universe_ticks ... bench: 87,258 ns/iter (+/- 14,632) test result: ok. 0 passed; 0 failed; 0 ignored; 1 measured; 0 filtered out 훨씬 나은것 같습니다! benchcmp 툴과 방금 생성한 두 텍스트 파일을 확인해보면 얼마나 나이졌는지 볼수 있습니다: $ cargo benchcmp before.txt after.txt name before.txt ns/iter after.txt ns/iter diff ns/iter diff % speedup universe_ticks 664,421 87,258 -577,163 -86.87% x 7.61 우와! 7.61 배나 빨라졌네요! WebAssembly는 의도적으로 일반적인 하드웨어 아키텍쳐와 밀접하게 매핑(mapping)되도록 설계돼 있지만, 이러한 네이티브 코드의 속도 향상이 WebAssembly 성능 향상으로도 이어질 수 있는지 확실히 확인해 보는 것도 중요합니다. wasm-pack build 명령어를 실행해서 .wasm 파일을 다시 빌드하고 http://localhost:8080/ 페이지를 새로고침 해주세요. 제 컴퓨터에서는 60 fps의 속도로 다시 작동하는 것이 확인됩니다. 브라우저의 프로파일러를 사용해서 다시 확인해보니 각 애니메이션 프레임이 10 밀리초씩 걸리는 것으로 확인됩니다. 성공적으로 잘 마무리한것 같습니다! 나머지 연산자를 if문 분기들로 바꾼 이후 페이지 렌더링 처리의 waterfall 뷰 스크린샷
